css:
#coffee-navigator {
  width: 20%;
  height: 100%;
  margin-left: 80%;
  overflow-y: scroll;
  overflow-x: hidden;
  font-size: 11px;
  font-family: 'Lucida Grande', 'Segoe UI', sans-serif;
  opacity: 1;
  background: #303030;
  box-shadow: inset -3px 0 0 rgba(0, 0, 0, 0.05);
  border: none;
  border-left: 1px solid rgba(0, 0, 0, 0.5);
  padding-top: 0;
}
#coffee-navigator .icon-text {
  display: inline-block;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  font-size: 11px;
  font-weight: bold;
  font-family: Inconsolata, Monaco, Consolas, 'Courier New', Courier;
  vertical-align: text-top;
  height: 16px;
}
#coffee-navigator .icon-class:before {
  display: inline-block;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  font-size: 11px;
  font-weight: bold;
  font-family: Inconsolata, Monaco, Consolas, 'Courier New', Courier;
  vertical-align: text-top;
  height: 16px;
  width: 16px;
  content: "c";
  border-radius: 8px;
  background-color: rgba(255, 255, 255, 0.07);
  line-height: 13px;
  padding-left: 3px;
  font-size: 16px;
  margin-top: -2px;
}
#coffee-navigator .icon-bound:before {
  display: inline-block;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  font-size: 11px;
  font-weight: bold;
  font-family: Inconsolata, Monaco, Consolas, 'Courier New', Courier;
  vertical-align: text-top;
  height: 16px;
  width: 16px;
  content: "=>";
  line-height: 11px;
  letter-spacing: -5px;
  font-size: 16px;
}
#coffee-navigator .icon-unbound:before {
  display: inline-block;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  font-size: 11px;
  font-weight: bold;
  font-family: Inconsolata, Monaco, Consolas, 'Courier New', Courier;
  vertical-align: text-top;
  height: 16px;
  width: 16px;
  content: "->";
  line-height: 11px;
  letter-spacing: -5px;
  font-size: 16px;
}
#coffee-navigator a.icon.text-error {
  color: #cc0000;
}
.has-navigator .editor-contents {
  width: 80% !important;
}
